import ExpenseItem from "./components/expenseItem";
const expenses = [
  {
    id: 'e1',
    title: 'table',
    amount: '120',
    date : new Date (2022, 9, 19)
  },{
    id: 'e2',
    title: 'Box',
    amount: '150',
    date : new Date (2021, 9, 19)
  },
  {
    id: 'e1',
    title: 'shoes',
    amount: '200',
    date : new Date (2022, 9, 19)
  }
]
function App(props) {
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem title={props.expenses.title}></ExpenseItem>
    </div>
  );
}

export default App;
